import React from "react";
import "./address.css"
import { Map, GoogleApiWrapper } from "google-maps-react";

export class Address extends React.Component {
    render() {
      const mapStyles = {
        width: "100%",
        height: "100%",
      };
      return (
        <Map
          google={this.props.google}
          zoom={15}
          style={mapStyles}
          initialCenter={{ lat: 9.761927, lng: 79.95244 }}
        />
      );
    }
  }
